import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.locator('.add-to-cart').first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.locator('div.cart').click();
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // 3. Extract initial quantity
    const initialQuantity = await page.locator('.cart-item .quantity').first().textContent();

    // 4. Click the '+' button to increase quantity
    await page.locator('.cart-item-quantity').first().getByRole('button', { name: '+' }).click();

    // Wait for the DOM to update, Playwright's auto-wait should handle this
    await page.waitForFunction(
      (selector) => document.querySelector(selector)?.textContent === '2',
      '.cart-item .quantity',
      { timeout: 5000 }
    );

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // 5. Extract final quantity
    const finalQuantity = await page.locator('.cart-item .quantity').first().textContent();

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2",
      extractedData: {
        initialQuantity: initialQuantity,
        finalQuantity: finalQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
